B.adw=new A.x("At African Straw Enterprise Ltd (ASE), we believe that every product tells a story\u2014a story of tradition, craftsmanship, and community impact. Based in Bolgatanga, in Northern Ghana, we specialize in producing handcrafted Bolga baskets each woven with care and dedication by our talented artisans. However, beyond the beauty and functionality of our products, lies a deeper purpose that drives everything we do: empowering women and transforming communities",null,B.am,null,null,null,null,null,null)
