B.aay=new A.x("ASE\u2019s mission is to alleviate poverty in rural communities by creating sustainable economic opportunities, especially for women who are often excluded from formal employment. We partner with over 5,000 skilled artisans\u2014primarily women\u2014providing them with the platform, training, and resources to develop their traditional weaving skills into a source of steady income. These women, who balance their craft with family duties and farming, are the backbone of our business. Through their hands, each basket becomes a symbol of resilience and creativity.",null,B.am,null,null,null,null,null,null)
B.ae2=new A.x("COMMUNITY IMPACT: BUILDING FUTURES BEYOND BASKETS",null,B.bO,null,null,null,null,null,null)
B.abz=new A.x("At ASE, we believe in giving back to the communities that give so much to us. Our commitment extends beyond just providing employment; it is about improving the quality of life. In addition to fair wages, we are dedicated to building infrastructure in these rural areas. By constructing boreholes, we provide access to clean, safe water\u2014a fundamental need for these communities. This initiative has drastically improved health and well-being, freeing up time for women and children that was once spent on fetching water from far distances.",null,B.am,null,null,null,null,null,null)
